import{_ as t,c as e,o as a,a2 as s}from"./chunks/framework.DfWqqJOM.js";const r="/assets/og-box.Bn7if4wi.jpg",l="/assets/launcheruiv1.BQ7ZyBiF.jpg",i="/assets/launcherui2v1.dvmjm4sE.jpg",d="/assets/setupbox.BpGlJI6i.jpg",o="/assets/launcheruiv2.rFHgPGSx.jpg",n="/assets/launcherui2v2.dC4_5YjL.jpg",h="/assets/launcherui3v2.DISS5uF1.jpg",c="/assets/streamzbox.DYld9QV_.png",g="/assets/streamzui.CyZEqg0z.jpg",A=JSON.parse('{"title":"NETTV Setupbox Variants","description":"","frontmatter":{},"headers":[],"relativePath":"pages/boxes.md","filePath":"pages/boxes.md","lastUpdated":null}'),x={name:"pages/boxes.md"},p=s('<h1 id="nettv-setupbox-variants" tabindex="-1">NETTV Setupbox Variants <a class="header-anchor" href="#nettv-setupbox-variants" aria-label="Permalink to &quot;NETTV Setupbox Variants&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This page has all the informations about the existing setup boxes from NETTV that exist in the market.</p></div><h2 id="_1-nx3000-box-2016-2019" tabindex="-1">1. NX3000 Box ( 2016-2019 ) <a class="header-anchor" href="#_1-nx3000-box-2016-2019" aria-label="Permalink to &quot;1. NX3000 Box ( 2016-2019 )&quot;">​</a></h2><p><img src="'+r+'" alt="Setupbox"></p><details class="details custom-block"><summary>Details</summary><p>These boxes MAC Address prefix starts as 78:C2:C0:90</p></details><p>NX3000 is the first IPTV setup box from NETTV. There are two variants of this box in the market. Each looks similar in design but both have different processor. The one Worldlink uses has Rockchip.</p><h3 id="hardware-specs" tabindex="-1">Hardware Specs <a class="header-anchor" href="#hardware-specs" aria-label="Permalink to &quot;Hardware Specs&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:right;">Basic</th><th style="text-align:left;">Spec Sheet</th></tr></thead><tbody><tr><td style="text-align:right;">SoC</td><td style="text-align:left;">Rockchip RK3229 ARM v7-A</td></tr><tr><td style="text-align:right;">GPU</td><td style="text-align:left;">ARM Mali400 MP2</td></tr><tr><td style="text-align:right;">Memory</td><td style="text-align:left;">1 GB RAM</td></tr><tr><td style="text-align:right;">Storage</td><td style="text-align:left;">4 GB</td></tr><tr><td style="text-align:right;">WiFi</td><td style="text-align:left;">2.4 GHz</td></tr><tr><td style="text-align:right;">Ethernet</td><td style="text-align:left;">100M</td></tr><tr><td style="text-align:right;">USB</td><td style="text-align:left;">2 x USB 2.0</td></tr><tr><td style="text-align:right;">Bluetooth</td><td style="text-align:left;">BT 4.0 (Support BT Remote)</td></tr><tr><td style="text-align:right;">HDMI</td><td style="text-align:left;">HDMI 2.1 ,Support HDMI CEC, Dynamic HDR And And 4K@24 Max Resolution Output</td></tr></tbody></table><h3 id="early-launcher-ui" tabindex="-1">Early Launcher UI <a class="header-anchor" href="#early-launcher-ui" aria-label="Permalink to &quot;Early Launcher UI&quot;">​</a></h3><p><img src="'+l+'" alt="Launcher"><img src="'+i+'" alt="LiveTV"></p><h2 id="_2-gx1001-box-2019-present" tabindex="-1">2. GX1001 Box ( 2019 - Present ) <a class="header-anchor" href="#_2-gx1001-box-2019-present" aria-label="Permalink to &quot;2. GX1001 Box ( 2019 - Present )&quot;">​</a></h2><p><img src="'+d+'" alt="Setupbox"></p><details class="details custom-block"><summary>Details</summary><p>These boxes MAC Address prefix starts as 00:22:6D:80</p></details><p>GX1001 also known as white setup box, started appearing after Worldlink got involved with the NETTV. In 2019, when NETTV parted it&#39;s ways with other ISPs, they decided to completely change the box for some reasons. These new boxes are slightly more powerful compared to the previous boxes. And they all come with Amlogic processor.</p><h3 id="hardware-specs-1" tabindex="-1">Hardware Specs <a class="header-anchor" href="#hardware-specs-1" aria-label="Permalink to &quot;Hardware Specs&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:right;">Basic</th><th style="text-align:left;">Spec Sheet</th></tr></thead><tbody><tr><td style="text-align:right;">SoC</td><td style="text-align:left;">Amlogic S905X ARMv8-A</td></tr><tr><td style="text-align:right;">GPU</td><td style="text-align:left;">ARM Mali-450</td></tr><tr><td style="text-align:right;">Memory</td><td style="text-align:left;">1 GB RAM</td></tr><tr><td style="text-align:right;">Storage</td><td style="text-align:left;">8 GB</td></tr><tr><td style="text-align:right;">WiFi</td><td style="text-align:left;">2.4 Ghz</td></tr><tr><td style="text-align:right;">Ethernet</td><td style="text-align:left;">100M</td></tr><tr><td style="text-align:right;">USB</td><td style="text-align:left;">2 x USB 2.0</td></tr><tr><td style="text-align:right;">Bluetooth</td><td style="text-align:left;">N/A</td></tr><tr><td style="text-align:right;">HDMI</td><td style="text-align:left;">HDMI 2.1 ,Support HDMI CEC, Dynamic HDR And And 4K@24 Max Resolution Output</td></tr></tbody></table><h3 id="early-launcher-ui-1" tabindex="-1">Early Launcher UI <a class="header-anchor" href="#early-launcher-ui-1" aria-label="Permalink to &quot;Early Launcher UI&quot;">​</a></h3><p><img src="'+o+'" alt="LauncherUI"><img src="'+n+'" alt="LauncherUI"><img src="'+h+'" alt="LauncherUI"></p><h2 id="_3-sei500ntv-box-2022-present" tabindex="-1">3. SEI500NTV Box ( 2022 - Present ) <a class="header-anchor" href="#_3-sei500ntv-box-2022-present" aria-label="Permalink to &quot;3. SEI500NTV Box ( 2022 - Present )&quot;">​</a></h2><p><img src="'+c+'" alt="Setupbox"></p><details class="details custom-block"><summary>Details</summary><p>These boxes MAC Address prefix starts as D4:CF:F9:00</p></details><p>SEI500NTV also known as NETTV Streamz+ was first announced in 2022. This box fixes all of the issues older boxes had and is the first box to allow apps side loading. It runs on Google Certified AndroidTV OS and is marketed as a streaming and gaming device by NETTV. The remote that comes with this box has builtin voice assistance and bluetooth connectivity. These boxes also use Amlogic processor.</p><h3 id="hardware-specs-2" tabindex="-1">Hardware Specs <a class="header-anchor" href="#hardware-specs-2" aria-label="Permalink to &quot;Hardware Specs&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:right;">Basic</th><th style="text-align:left;">Spec Sheet</th></tr></thead><tbody><tr><td style="text-align:right;">SoC</td><td style="text-align:left;">Amlogic S905X2-N ARMv8-A</td></tr><tr><td style="text-align:right;">GPU</td><td style="text-align:left;">ARM Mali-G31 MP2</td></tr><tr><td style="text-align:right;">Memory</td><td style="text-align:left;">2 GB RAM</td></tr><tr><td style="text-align:right;">Storage</td><td style="text-align:left;">8 GB</td></tr><tr><td style="text-align:right;">WiFi</td><td style="text-align:left;">2.4 / 5 Ghz</td></tr><tr><td style="text-align:right;">Ethernet</td><td style="text-align:left;">100M</td></tr><tr><td style="text-align:right;">USB</td><td style="text-align:left;">1 x USB 2.0 , 1 x USB 3.0</td></tr><tr><td style="text-align:right;">Bluetooth</td><td style="text-align:left;">4.0</td></tr><tr><td style="text-align:right;">HDMI</td><td style="text-align:left;">HDMI 2.1 ,Support HDMI CEC, Dynamic HDR And And 4K@24 Max Resolution Output</td></tr></tbody></table><h3 id="early-launcher-ui-2" tabindex="-1">Early Launcher UI <a class="header-anchor" href="#early-launcher-ui-2" aria-label="Permalink to &quot;Early Launcher UI&quot;">​</a></h3><p><img src="'+g+'" alt="LauncherUI"></p>',26),u=[p];function y(m,b,f,_,S,T){return a(),e("div",null,u)}const B=t(x,[["render",y]]);export{A as __pageData,B as default};
